import React from 'react'

export const TreeCrawl = ({level, items}) => {

    const marginDist = level+'rem'
    const MARGIN = {marginLeft:marginDist}
    return (
        <ul style={MARGIN}>
            {Object.keys(items).map((key, index)=>{
                var item = items[key]
                return (
                <li key={key}>
                    <span>{item.title}</span>
                    {item.children &&
                    <TreeCrawl level={level +1} items={item.children} />
                    }                    
                </li>)             
            })}
        </ul>
    )
}
